import React from "react";
import PropTypes from "prop-types";
import { Menu, Input, Row, Col } from "antd";
import styled from "styled-components";

const LayoutMain = ({ children }) => {
  return (
    <div>
      <Menu mode="horizontal">
        <Menu.Item>
          <Link href="/">
            <a>노드버드</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href="/species">
            <a>Species</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <SearchInput enterButton></SearchInput>
        </Menu.Item>
        <Menu.Item>
          <Link href="/map">
            <a>Map</a>
          </Link>
        </Menu.Item>
      </Menu>
      <Row gutter={8}>
        <Col xs={24} md={6}>
          left contents
        </Col>
        <Col xs={24} md={12}>
          <div>target menu</div>
          {children}
        </Col>
        <Col xs={24} md={6}>
          right contents
        </Col>
      </Row>
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default LayoutMain;
